    <div id=""pagepiling"">

        <div class=""section"" id=""start"">
            <h1 style=""background:rgba(0,0,0,.4);padding:40px!important;"">Best of Zimbabwe And Krugar</h1>
            <p style=""background:rgba(0,0,0,.4);padding:10px");
                WriteLiteral(@"!important;"">Scroll To Begin Tour</p>
        </div>

        <div class=""section"" id=""day1"">


            <div class=""bgdark"">
                <h1>Victoria Falls to Hwange National Park</h1>
                This morning we leave the rumble and adventure of Victoria Falls behind us as we make the journey south to Hwange National Park. After lunch we spend the afternoon exploring Hwange National Park in open game-viewing vehicles. Hwange is the largest of Zimbabwe’s national parks and offers excellent opportunities for viewing the diversity of wildlife that calls the park home. We return to camp this evening and enjoy dinner around our campfire.
                route
                <br />
                <br />
                <ul>
                    <li>
                        Included activities:
                        Afternoon game drive Hwange National Park,
                    </li>


                </ul>
            </div>

        </div>

        <div class=""section"" id=""d");
                WriteLiteral(@"ay2"">
            <div class=""bgdark"">
                <h1>
                    Hwange National Park to Matopos National Park
                </h1>
                After breakfast we continue south towards Bulawayo, the second largest city in Zimbabwe. Our afternoon will be spent exploring the Matopos National Park with a local guide. The park received recognition as a UNESCO natural World Heritage Site in 2003 and includes an intensive protection zone that is home to both Black and White Rhinoceros. Named after the Ndebele word “Matobo “, whose meaning “bald heads” refers to the rounded granite hills that surround it. We return to Bulawayo and our overnight stop for the night.
                <br />
                <br />
                <ul>
                    <li>
                        Included activities:
                        Afternoon game drive Matopos National Park
                    </li>
                </ul>

            </div>
        </div>

        <div class=""section"" id");
                WriteLiteral(@"=""day3"">
            <div class=""bgdark"">
                <h1>
                    Great Zimbabwe Ruins
                </h1>
                Our journey today takes us to Masvingo and the Great Zimbabwe Ruins. This afternoon we will enjoy a guided walking tour of this historic site. Dating back to the Late Iron Age, this UNESCO World Heritage Site was once the capital of the Kingdom of Zimbabwe. We take time this afternoon to marvel at the intricate stone work and experience the heritage of this monument to early Zimbabwean civilisation.
                <br />
                <br />
                <ul>
                    <li>
                        Accommodation:
                        Accommodated (with facilities) (2 nights)
                    </li>
                    <li>
                        Included activities:
                        Visit to the Great Zimbabwe Ruins
                    </li>
                </ul>

            </div>
        </div>

        <div class=""se");
                WriteLiteral(@"ction"" id=""day4"">
            <div class=""bgdark"">
                <h1>
                    Tshipise
                </h1>
                Leaving the sites of Zimbabwe behind we cross the Limpopo River and enter South Africa this afternoon. Our overnight stop allows us an opportunity to end the day with a swim in the hot springs of Tshipise.
                <br />
                <br />
                <ul>
                    <li>
                        Accommodation:
                        Accommodated (with facilities) (2 nights)
                    </li>
                    <li>
                        Included activities:
                        Hot Springs Tshipise
                    </li>
                </ul>

            </div>
        </div>

        <div class=""section"" id=""day5"">

            <div class=""bgdark"">
                <h1>Johannesburg</h1>
                This morning we take the highway south to Johannesburg, we arrive at Belvedere Estate in the late after");
                WriteLiteral(@"noon and all travellers are invited to join us for a traditional Braai tonight, this can be booked with your guide on the day before arrival. Many great tales are shared around the braai fires and tonight presents an opportunity to join fellow travellers in celebrating the many wonders of African travel.
                <br />
                <ul>
                    <li>
                        Optional activities:
                        Traditional Braai at Belvedere Estate
                    </li>

                </ul>
            </div>

        </div>

        <div class=""section"" id=""day6"">

            <div class=""bgdark"">
                <h1>Johannesburg to Kruger National Park</h1>
                Leaving the city of Johannesburg behind us we make our way east through the coalfields of Mpumalanga. Just after arrival at camp the Activity package offers the opportunity to enjoy a late afternoon Sundowner in the African Bush, after which the group will enjoy some local dancing and di");
                WriteLiteral(@"nner around the campfire.
                <br />
                <br />
                <br />
                <ul>
                    <li>
                        Included activities:
                        Local Dinner and Dance,
                        Sundowner drive
                    </li>

                </ul>
            </div>

        </div>

        <div class=""section"" id=""day7"">

            <div class=""bgdark"">
                <h1>Kruger National Park</h1>
                This morning we enter the Kruger National Park for a full day of game viewing. Our Activity Package offers you the opportunity to explore the park in open game viewing vehicles, giving you access to areas our truck can’t always go. The Kruger is home to many species of wildlife and offers the chance of sighting the famed Big-5. We return to camp in the early evening for dinner and a well-deserved rest.
                <br />
                <br />
                <br />
                <ul>
        ");
                WriteLiteral(@"            <li>
                        Included activities:
                        4×4 Game drive in Kruger National Park,
                        Kruger Afternoon Game Drive
                    </li>

                </ul>
            </div>

        </div>

        <div class=""section"" id=""day8"">

            <div class=""bgdark"">
                <h1>Kruger National Park</h1>
                This morning we re-enter the Kruger National Park for a full-day of game viewing. Our activity package offers you the opportunity to explore the park in open game viewing vehicles, giving you access to areas our truck can’t always go. We return in the mid-afternoon and end the day with a Sundowner in the African Bush.
                <br />
                <br />
                <br />
                <ul>
                    <li>
                        Included activities:
                        Panorama Route,
                        God’s Window,
                        Three Rondavels,
 ");
                WriteLiteral(@"                       Kruger Game drive
                    </li>

                </ul>
            </div>

        </div>

        <div class=""section"" id=""day9"">

            <div class=""bgdark"">
                <h1>Kruger National Park to Johannesburg</h1>
                As is customary when on Safari, we rise early this morning to enjoy a Guided Bush Walk after which our journey back to Johannesburg will commence. We arrive at Belvedere Estate in the late afternoon and all travellers are invited to join us for a traditional Buffet Dinner tonight. Many great tales are shared around the dinner table and tonight presents an opportunity to join fellow travellers in celebrating the many wonders of African travel.
                <br />
                <br />
